data_info10=( '정책정보',   'i10',  '보호기관', '독거노인·중증장애인 응급안전알림서비스', '보건복지부',    '독거노인과 중증 장애인의 가정에 화재ㆍ가스 감지센서 등을 설치하여  응급상황 발생 시 독거노인 및 중증 장애인 분들이 신속하게 대처하거나 소방서에 신고할 수 있는 체계를 구축합니다.')
data_info11=(  '정책정보',  'i11',  '보호기관', '독거노인종합지원센터 운영',    '독거노인종합지원센터',      '독거노인 보호를 위해 노인돌봄 기본서비스 및 독거노인 사랑잇기사업 등의 원활한 추진을 도와줍니다.')
data_info12=(  '정책정보',  'i12',  '병원',   '치매치료관리비지원사업',  '중앙치매센터',      '노후에도 안정적인 삶을 누릴 수 있도록 치매를 조기에 치료하고 지속적으로 관리하여 증상을 호전시키거나 심화를 예방합니다.')
data_info13=( '정책정보',   'i13',  '병원',   '의료급여 틀니·치과임플란트',   '보건복지부',   '노인 수급권자의 경제적 부담을 완화하고, 치아건강 증진을 위해 틀니 및 치과 임플란트에 대하여 의료급여를 지원합니다.')
data_info14=(  '정책정보',  'i14',  '주거요양', '재가급여', '국민건강보험공단',     '노인에게 장기요양서비스를 제공하여 중장년층과 자녀 등 모든 세대의 고충을 경감하고 품위 있는 노후생활을 할 수 있습니다.')
data_info15=(  '정책정보',  'i15',  '주거요양', '주택담보노후연금보증',   '한국주택금융공사',   '소득이 없거나 부족한 노인이, 보유하고 있는 주택을 담보로 매월 일정금액의 대출금을 연금형식으로 받아 안정적인 노후 생활을 할 수 있습니다.')
data_info17=(  '정책정보',  'i17',  '일자리',  '고령층 정보화교육',    '한국정보화진흥원',  '정보활용에 취약한 고령층을 대상으로 IT활용 교육의 기회를 제공하여사회경제적으로 자생력과 경쟁력을 갖출 수 있도록교육사업과 사회통합프로그램을 운영합니다.')
data_info18=(  '정책정보',  'i18',  '일자리',  '웹정보접근성제고', '한국정보화진흥원',     '웹 정보에 취약한 장애인과 고령자 등이 지식사회의 필수도구인 인터넷에 자유롭게 접근하여 정보를 활용할 수 있는 환경을 조성합니다.')
data_info19=(  '정책정보',  'i19',  '주거요양', '장기요양급여이용지원',   '국가보훈처',     '고령의 국가유공자가 요양등급을 판정 받았지만 소득이 적어 요양기관의 서비스를 받기 힘들 때 노후생활 보장을 위하여 본인부담금의 일부를 지원합니다.')
data_info20=(  '정책정보',  'i20',  '보호기관', '취약농가인력지원(영농도우미, 행복나눔이(가사도우미) 지원)', '농림축산식품부',   '사고, 질병 농가에는 영농도우미를 지원하여 안정적인 영농활동으로농가소득을 증대할 수 있도록 돕고, 고령의 취약 농촌 가정에는 행복나눔이를  지원하여 기초적인 가사생활을 유지할 수 있도록 돕습니다.')
data_info21=(  '정책정보',  'i21',  '주거요양', '행복주택 공급',  '국토교통부',    '사회초년생, 신혼부부, 대학생, 고령자 등의 주거 안정을 위해 대중교통을 이용하기 편리한 지역에 주변 시세보다 저렴한 임대주택을 공급합니다.')
data_info22=( '정책정보',   'i22',  '보호기관', '기초연금', '보건복지부 기초연금',    '생활이 어려운 어르신에게 안정적인 소득기반을 제공하여 생활안정을 지원합니다.')
data_info23=(  '정책정보',  'i23',  '주거요양', '시설급여', '국민건강보험공단',     '자녀에게 부담을 주지 않고 어르신이 시설에서 전문적인 장기요양서비스를 받을 수 있도록 지원합니다.')
data_info24=(  '정책정보',  'i24',  '일자리',  '어르신 문화프로그램운영', '한국문화원연합회',   '어르신들이 건전한 여가활동과 문화활동을 통해 삶의 질을 높일 수 있도록 돕습니다.')
data_info25=(  '정책정보',  'i25',  '주거요양', '보훈요양원 이용지원',   '국가보훈처',    '장기요양이 필요한 국가유공자 등이 보훈요양원을 이용할 시,본인부담금의 일부를 지원함으로써 경제적인 부담을 덜고, 안락한 노후생활을 할 수 있도록 보장합니다.')
