data_info28=(  '정책정보',  'i28',  '일자리',  '온라인 정보화교육',    '배움나라',   '평생교육사이트인 ‘배움나라(estudy)’에서 국민의 정보화 역량을 강화하고 취약계층 정보화 교육을 위한 교육콘텐츠를 개발하여 보급합니다.')

