#VIEW5: protectrion + carecenter = 전체 노인 보호기관
cursor.execute("CREATE VIEW protection_all as SELECT pcity as cpcity, pName as cpname, pphone as cpphone, paddress2 as cpaddress FROM protection UNION SELECT ccity as cpcity, cName as cpname, cphone as cpphone, caddress2 as cpaddress FROM carecenter order by cpcity")


#TRIGGER1 ifoaddress에 업데이트가 일어난 후, infopolicy의 iadmin(정책 관리부서이름)이 함께 업데이트됨
cursor.execute("CREATE TRIGGER infoAddress_ianame_update AFTER UPDATE ON infoAddress FOR EACH ROW update infopolicy set iadmin = new.ianame where iadmin = old.ianame")

#TRIGGER2 todayskitchen에 인서트가 일어나기 전, kitchensoup의 isopen='N'으로 세팅해줌(데이터 초기화) 
cursor.execute("CREATE TRIGGER `kitchensoup_insert_setN` BEFORE INSERT ON `todayskitchen` FOR EACH ROW UPDATE kitchensoup SET isopen = 'N'")
#TRIGGER3 todayskitchen에 인서트가 일어나고 twantday=1(사용자가 원하는 날짜가 월요일 이라면), 해당요일의 kitchensoup의 isopen='Y'가 됨(현재 운영중) 
cursor.execute(" CREATE TRIGGER `kitchensoup_insert1` AFTER INSERT ON todayskitchen FOR EACH ROW BEGIN IF NEW.twantday = 1 THEN UPDATE kitchensoup SET isopen = 'Y' where kdate like '%월%'; END IF; END")
#TRIGGER4 todayskitchen에 인서트가 일어나고 twantday=2(사용자가 원하는 날짜가 화요일 이라면), 해당요일의 kitchensoup의 isopen='Y'가 됨(현재 운영중) 
